import './App.css';

function App() {

    function addInput(event: any) {
        addTrack(event)
    }

    function addTrack(event: any) {
        console.log(event.currentTarget.value)
    }
  return (
    <div className="App">
     <div>
         <input type='text'
                onChange={ (event) => addInput(event.currentTarget.value) }></input>
         <button onClick={ addTrack }>Добавить</button>
     </div>
    </div>
  );
}

export default App;
